import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { MdSettings } from 'react-icons/md';

const UserTable = () => {

  return(
    <Container>
      <Row>
        <Col>
          <span>Flexsys</span>
          <span><MdSettings/></span>
        </Col>
      </Row>
    </Container>
  );
}

export default UserTable;
